import React from 'react';

const HomePage = () => {

    return (
        <div class="HomePage">
            <h1 class="Title">
                <li id="titleOne">Hi, Nice to meet you!</li><br/>
                <li id="titleTwo">Welcome to my porfolio</li><br/>
            </h1>
            <div>
                <li>About Me</li>
                <li>Education</li>
                <li>Projects</li>
                <li>Achievements</li>
            </div>

        </div>
    )

};

export default HomePage;
